#include "MainWindow.h"
#include "Game.h"
#include <random>

Game::Game( MainWindow& wnd )
	:
	wnd( wnd ),
	gfx( wnd ),
	rng( rd() ),
	xDist( 0,770 ),
	yDist( 0,570 ),
	goal( xDist( rng ),yDist( rng ) ),
	meter( 20,20 )
{
	std::uniform_real_distribution<float> vDist( -2.5f * 60.0f,2.5f * 60.0f );
	for( int i = 0; i < nPoo; ++i )
	{
		poos[i].Init( xDist( rng ),yDist( rng ),vDist( rng ),vDist( rng ) );
	}
	title.Play();
}

void Game::Go()
{
	gfx.BeginFrame();	
	UpdateModel();
	ComposeFrame();
	gfx.EndFrame();
}

void Game::UpdateModel()
{
	const float dt = ft.Mark();

	goal.UpdateColor();
	if( isStarted && !isGameOver )
	{
		dude.Update( wnd.kbd,dt );
		dude.ClampToScreen();

		for( int i = 0; i < nPoo; ++i )
		{
			poos[i].Update( dt );
			if( poos[i].TestCollision( dude ) )
			{
				isGameOver = true;
				fart.Play( rng );
			}
		}

		if( goal.TestCollision( dude ) )
		{
			goal.Respawn( xDist( rng ),yDist( rng ) );
			meter.IncreaseLevel();
			pickup.Play( rng );
		}
	}
	else
	{
		if( wnd.kbd.KeyIsPressed( VK_RETURN ) )
		{
			isStarted = true;
		}
	}
}

