void Game::ComposeFrame()
{
	if( !isStarted )
	{
		DrawTitleScreen( 325,211 );
	}
	else
	{
		goal.Draw( gfx );
		for( int i = 0; i < nPoo; ++i )
		{
			poos[i].Draw( gfx );
		}
		dude.Draw( gfx );
		if( isGameOver )
		{
			DrawGameOver( 358,268 );
		}
		meter.Draw( gfx );
	}
}
